function Header() {
    const [sticky, setSticky] = useState(false);
    const changeColor = ()=>{
        if(window.scrollY >= 120){
            setSticky(true)
        }
        else{
            setSticky(false)
        }
    }
    window.addEventListener('scroll', )



    return (
        <>
            <header>
                <div className={`navbar ${sticky ? 'dark-nav' : ''}`}>
                    <div className="nav-container">
                        <h3 className="logo">Techifo</h3>
                        <ul className="links">
                            <li><a href="www.google.com">Home</a></li>
                            <li><a href="www.google.com">About Us</a></li>
                            <li><a href="www.google.com">Service</a></li>
                            <li><a href="www.google.com">Contact Us</a></li>
                        </ul>
                        <button className="action-btn">Get started</button>
                        <i className="toggle_btn fa-solid fa-bars" id="btn">hh</i>
                    </div>
                    <div id="drop-down-menu">
                        <ul>
                            <li><a href="www.google.com">Home</a></li>
                            <li><a href="www.google.com">About Us</a></li>
                            <li><a href="www.google.com">Service</a></li>
                            <li><a href="www.google.com">Contact Us</a></li>
                        </ul>
                        <button className="action-btn">Get started</button>
                    </div>
                </div>
            </header>
        </>
    );
}

export default Header;


